import styled from 'styled-components';
import {Link} from "react-router-dom";

const BlueButtonLink = styled(Link)`
  display: inline-block;
  background-color: #865858;
  color:#fff;
  border:0;
  border-radius: 5px;
  padding: 12px 10px;
  text-decoration: none;
`;

export default BlueButtonLink;
